    private async Task OnPaginationChanged(int page)
    {
        CurrentPage = page + 1;
        await RefreshDataSource();
    }

    protected void HandleItemPerPageChange(byte newItemPerPage)
    {
        RecordsPerPage = newItemPerPage;
        StateHasChanged();
    }

